function useInput(opts) {
 const [calc, setCalc]=React.useState('')
 const [valueb,setValueb] =React.useState('')
 const [value, setValue] = React.useState('');
  const input = <input value={(value)}onChange={e => setValue(e.target.value)}{...opts} />
  const inputt = <inputt valueb={(valueb)}onChange={e => setCalc(e.target.value)}{...opts} />
  return [value, input ,inputt , calc];
}
export default useInput
